const G={W:360,H:200,GROUND:200-16};

// ==== „Çª„ÉÉ„Éà„Ç¢„ÉÉ„Éó ====
const cv=document.getElementById('cv'),ctx=cv.getContext('2d');
function fit(){const d=Math.max(1,Math.min(3,devicePixelRatio||1));
  const s=Math.floor(Math.min(innerWidth/G.W,innerHeight/G.H)*d);
  cv.width=G.W*s; cv.height=G.H*s; cv.style.width=(G.W*s/d)+'px'; cv.style.height=(G.H*s/d)+'px';
  ctx.setTransform(s,0,0,s,0,0); ctx.imageSmoothingEnabled=false;}
fit(); addEventListener('resize',fit);

// ==== Èü≥ÔºàWebAudioÔºö„É¢„Éê„Ç§„É´Ëß£Èå†‰ªò„Åç„ÉªË∂ÖËªΩÈáèSFXÔºâ ====
let AC, audioUnlocked=false;
function audioCtx(){ if(!AC) AC=new (window.AudioContext||window.webkitAudioContext)(); return AC; }
// ÂàùÂõûÊìç‰Ωú„ÅßËß£Èå†ÔºàiOS/AndroidÂØæÁ≠ñÔºâ
['touchstart','mousedown','keydown'].forEach(ev=>{
  addEventListener(ev, async ()=>{
    try{ const c=audioCtx(); if(c.state==='suspended') await c.resume(); audioUnlocked=true; }catch(e){}
  }, {passive:true});
});
function beep(freq=440, dur=0.07, type='square', vol=0.18){
if (muted) return;
  try{
    const c=audioCtx(), now=c.currentTime, o=c.createOscillator(), g=c.createGain();
    o.type=type; o.frequency.setValueAtTime(freq, now);
    o.connect(g); g.connect(c.destination);
    // Á∞°ÊòìADÂåÖÁµ°
    const ATT=0.005, DEC=dur;
    g.gain.setValueAtTime(0.0001, now);
    g.gain.exponentialRampToValueAtTime(vol, now+ATT);
    g.gain.exponentialRampToValueAtTime(0.0001, now+ATT+DEC);
    o.start(now); o.stop(now+ATT+DEC+0.005);
  }catch(e){}
}

// ==== Áä∂ÊÖã ====
let started=false,over=false,score=0,best=0,lives=3, t=0;
const S={x:92,y:G.GROUND,vy:0,onG:true,bg:0,s:1.95,bob:0};
const items=[], hz=[]; let si=34, sh=66;

// ==== „Çπ„Éó„É©„Ç§„Éà ====
let moai=null;
if(USE_SPRITE && SPRITE_DATA){
  moai=new Image(); moai.src="data:image/png;base64,"+SPRITE_DATA;
}

// ==== ÊèèÁîª ====
function sky(){
 ctx.fillStyle='#79bff0'; ctx.fillRect(0,0,G.W,G.H);
 ctx.globalAlpha=.12; ctx.fillStyle='#fff';
 for(let y=0;y<G.H-32;y+=2){for(let x=(y>>1)&1?1:0;x<G.W;x+=2) ctx.fillRect(x,y,1,1)} ctx.globalAlpha=1;
 ctx.fillStyle='#fff';
 for(let i=0;i<6;i++){const x=((i*90-(S.bg*.25)%(G.W+90))-20)|0, y=22+(i%2)*10; ctx.fillRect(x,y,16,4); ctx.fillRect(x+5,y-3,12,3); }
}
function ground(){
 for(let x=0;x<G.W;x+=16){ctx.fillStyle='#2a612a';ctx.fillRect(x,G.H-16,16,6);
  ctx.fillStyle='#72d65c';ctx.fillRect(x+((x>>1)&1),G.H-14,1,1);
  ctx.fillStyle='#60352f';ctx.fillRect(x,G.H-10,16,10);}
 // Êé•Âú∞ÂΩ±
 ctx.globalAlpha=.25; ctx.fillStyle='#000';
 ctx.fillRect((S.x-10)|0,(G.GROUND-3)|0,20,2); ctx.globalAlpha=1;
}
function drawMoai(){
 if(moai && moai.complete){
   // Â∑¶Âêë„Åç„Å´ÂèçËª¢„Åó„Å¶ÊèèÁîª
   const sw=moai.width,sh=moai.height,sc=Math.min(64/sw,64/sh),dw=(sw*sc)|0,dh=(sh*sc)|0;
   const bob=Math.sin(S.bob)*1.1;
   ctx.save(); ctx.translate(S.x,(S.y-dh+bob)|0); ctx.scale(-1,1);
   ctx.drawImage(moai,0,0,sw,sh,-(dw>>1),0,dw,dh); ctx.restore(); return;
 }
 // ‚òÖËªΩÈáèÁâà„Éô„ÇØ„Çø„ÉºÊèèÁîªÔºà„É¢„Ç¢„Ç§È¢®Ôºâ
 const x=S.x, y=S.y;
 ctx.save(); ctx.translate(x,y); ctx.scale(-1,1); // Â∑¶Âêë„Åç
 const h=52, w=36; const oy=-h;
 // Â§ñÂΩ¢
 ctx.fillStyle='#9a8f86'; ctx.fillRect(-(w>>1), oy, w, h);
 // Èºª
 ctx.fillStyle='#8b8179'; ctx.fillRect(-2, oy+18, 14, 12);
 // ÁõÆ„ÉªÂè£
 ctx.fillStyle='#3a3530'; ctx.fillRect(-6, oy+14, 6, 3); ctx.fillRect(8, oy+14, 6, 3);
 ctx.fillRect(-4, oy+36, 18, 3);
 // „Éè„Ç§„É©„Ç§„Éà
 ctx.fillStyle='#bdb5ad'; ctx.fillRect(-(w>>1)+2, oy+4, 6, 10);
 ctx.restore();
}

// ==== ÈöúÂÆ≥Áâ©„Éª„Ç¢„Ç§„ÉÜ„É† ====
function drawBottle(b){
 const x=(b.x-9)|0, y=(b.y-26)|0;
 ctx.fillStyle='#282018'; ctx.fillRect(x-1,y+5,1,20); ctx.fillRect(x+18,y+5,1,20); ctx.fillRect(x,y+25,18,1);
 ctx.fillStyle='#f4f7ff'; ctx.fillRect(x+2,y+7,14,18); ctx.fillRect(x+4,y+5,10,2); ctx.fillRect(x+5,y+3,8,2);
 ctx.fillStyle='#5a8cff'; ctx.fillRect(x+4,y+13,10,3); ctx.fillStyle='#2f5fe6'; ctx.fillRect(x+5,y+2,8,1);
 ctx.fillStyle='#fff'; ctx.fillRect(x+4,y+10,2,8);
}
function drawDrone(d){
 const x=(d.x-12)|0, y=(d.y-16)|0;
 ctx.fillStyle='#2a2f3a'; ctx.fillRect(x+4,y+6,16,8);
 ctx.fillStyle='#4a5568'; ctx.fillRect(x+5,y+7,14,6);
 ctx.fillStyle='#6b7280'; ctx.fillRect(x, y+4, 8,2); ctx.fillRect(x+16,y+4,8,2);
 ctx.fillStyle='#ff3b3b'; ctx.fillRect(x+11,y+9,2,2);
}

// ==== ÈÄ≤Ë°å ====
function reset(){
 over=false; started=false; score=0; lives=3; t=0;
 S.x=92; S.y=G.GROUND; S.vy=0; S.onG=true; S.bg=0; S.s=1.95; S.bob=0;
 items.length=0; hz.length=0; si=34; sh=66;
 document.getElementById('sc').textContent=0; document.getElementById('lf').textContent=3;
}
function step(){
 if(!started||over) return;
 t++; S.bg+=S.s; S.bob+=.28;
 S.vy+=.48; S.y+=S.vy; if(S.y>=G.GROUND){S.y=G.GROUND; S.vy=0; S.onG=true;}
 // Âá∫Áèæ
 if(--si<=0){ items.push({x:G.W+16,y:G.GROUND-8-Math.random()*26,t:false}); si=(28+Math.random()*34)|0; }
 if(--sh<=0){ hz.push({x:G.W+16,y:G.GROUND-(Math.random()<.6?12:0),h:false}); sh=(54+Math.random()*44)|0; }
 // ÁßªÂãïÔºàÂ∑¶„Çπ„ÇØ„É≠„Éº„É´Ôºâ
 items.forEach(it=>it.x-=S.s); hz.forEach(h=>{h.x-=S.s*1.25; if(h.y<G.GROUND) h.y=G.GROUND-12-Math.sin((t+h.x)*.18)*8;});
 // ÂΩì„Åü„ÇäÂà§ÂÆö
 const L=S.x-18,R=S.x+18,T=S.y-36,B=S.y;
 items.forEach(it=>{ if(!it.t && Math.abs(it.x-S.x)<12 && Math.abs((it.y-10)-(S.y-18))<14){ it.t=true; score+=10; beep(880,.06,'triangle'); }});
 hz.forEach(h=>{ if(h.h) return; const hL=h.x-12,hR=h.x+12,hT=h.y-16,hB=h.y; if(R>hL&&L<hR&&B>hT&&T<hB){ h.h=true; lives=Math.max(0,lives-1); beep(220,.12,'sawtooth'); }});
 // Áâá‰ªò„Åë
 for(let i=items.length-1;i>=0;i--) if(items[i].x<-20||items[i].t) items.splice(i,1);
 for(let i=hz.length-1;i>=0;i--) if(hz[i].x<-20||hz[i].h) hz.splice(i,1);
 // Â∞ë„Åó„Åö„Å§Âä†ÈÄü
 if(t%600===0) S.s=Math.min(S.s+.2,3.8);
}
function render(){
 sky(); ground();
 items.forEach(drawBottle); hz.forEach(drawDrone); drawMoai();
 document.getElementById('sc').textContent=score; document.getElementById('lf').textContent=lives;
 if(lives<=0 && !over){ over=true; best=Math.max(best,score);
   document.getElementById('over').style.display='flex';
   document.getElementById('scoreline').textContent='SCORE: '+score+'  BEST: '+best;
 }
}
function loop(){ step(); render(); requestAnimationFrame(loop); } loop();

// ==== ÂÖ•Âäõ ====
function start(){ 
  if(!started){
    // ‚òÖ„Çπ„Éû„ÉõÈü≥Ëß£Á¶ÅÔºà„É¶„Éº„Ç∂„ÉºÊìç‰ΩúÂÜÖ„ÅßresumeÔºâ
    try{ 
      const c = audioCtx(); 
      if(c.state === 'suspended') c.resume(); 
      audioUnlocked = true; 
    }catch(e){}
    started = true;
    document.getElementById('start').style.display = 'none';
    beep(660, .08, 'square');
  }
}function jump(){ start(); if(S.onG){ S.vy=-8.6; S.onG=false; beep(700,.06,'square'); } }
function drop(){ if(!S.onG) S.vy+=2.8; }

document.getElementById('go').onclick=start;
document.getElementById('retry').onclick=()=>{ document.getElementById('over').style.display='none'; reset(); document.getElementById('start').style.display='flex'; };
document.getElementById('jump').addEventListener('touchstart',e=>{e.preventDefault();jump()},{passive:false});
document.getElementById('drop').addEventListener('touchstart',e=>{e.preventDefault();drop()},{passive:false});
addEventListener('keydown',e=>{
 if(e.code==='Enter'&&!started) start();
 if(!started||over) return;
 if((e.code==='Space'||e.code==='ArrowUp')&&S.onG) jump();
 else if(e.code==='ArrowDown') drop();
});

let muted = false;

function updateMuteUI(){
  const b = document.getElementById('mute');
  if(!b) return;
  b.textContent = muted ? 'üîá Èü≥OFF' : 'üîä Èü≥ON';
}

async function toggleMute(){
  try{
    const c = audioCtx();
    if (c.state === 'suspended') await c.resume();
    audioUnlocked = true;
  }catch(e){}
  muted = !muted;
  updateMuteUI();
  if(!muted) beep(660,0.06,'square',0.16);
}

document.getElementById('mute')?.addEventListener('click', toggleMute);
updateMuteUI();


// Ëµ∑Âãï
reset();
})();
</script>
